--
-- Definition of function `event_cost`
--

DROP FUNCTION IF EXISTS `event_cost`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` FUNCTION `event_cost`(event varchar(25),guest_count integer(10)) RETURNS int(11)
BEGIN
	return (select sum(if(s.service_name='Food',s.charges*guest_count,s.charges)) as "CHARGES"
    from service_list s
    join event_booking e on (e.service_code=s.service_code)
    join event_master em on(em.event_id=e.event_id)
    where em.event_name=event);
	end $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `find_charges_for`
--

DROP PROCEDURE IF EXISTS `find_charges_for`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `find_charges_for`(event varchar(25),guest_count integer )
BEGIN
    select em.event_name as "EVENT NAME",sum(if(s.service_name='Food',s.charges*guest_count,s.charges)) as "CHARGES"
    from service_list s
    join event_booking e on (e.service_code=s.service_code)
    join event_master em on(em.event_id=e.event_id)
    where em.event_name=event;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

