CREATE DEFINER=`root`@`localhost` PROCEDURE `find_services_in`(event varchar(25),guest_count integer)
BEGIN
    select s.service_name as "SERVICE NAME",if(s.service_name='Food',s.charges*guest_count,s.charges) as "CHARGES"
    from service_list s
    join event_booking e on (e.service_code=s.service_code)
    join event_master em on(em.event_id=e.event_id)
    where em.event_name=event;
END $$
