DROP PROCEDURE IF EXISTS `match_finder`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `match_finder`(input int, in_gender varchar(15))
    MODIFIES SQL DATA
    COMMENT 'Select addresses with that id.'
begin
start transaction;
select distinct dr.first_name, r.first_name from register dr join register r join personal_details p
where(
(dr.user_id = input and r.user_id in (select  user_id from personal_details where (looking_for = in_gender and
mothertongue in (select partner_mothertongue from personal_details where user_id = input) and
education_field in (select partners_edu_field from personal_details where user_id = input) and
religion in (select partner_religion from personal_details where user_id = input) and
user_id in (select user_id from personal_details where
YEAR(CURDATE())- YEAR(D_O_B) > p_age_range_from and YEAR(CURDATE())- YEAR(D_O_B) < p_age_range_to) and
(my_diet    =  (select partners_diet_type from personal_Details where user_id = input) or
My_cast  =  (select partners_cast from personal_Details where user_id = input) or
my_sub_cast  =  (select partners_subcast from personal_Details where user_id = input) or
my_country  =  (select partners_country from personal_Details where user_id = input) or
relationship_status  =  (select partners_marrital_status from personal_Details where user_id = input) or
my_professional_area  =  (select partners_prof_area from personal_Details where user_id = input) or
I_m_working_as  =  (select partners_working_as from personal_Details where user_id = input) or
smoking  =  (select partners_smoking from personal_Details where user_id = input) or
drink  =  (select partners_drink from personal_Details where user_id = input) or
complexion  =  (select partners_complexion from personal_Details where user_id = input)
)))));

commit;
end $$
